import "./App.css";
import MainPage from "./Pages/MainPage/MainPage";
import { ActiveSearchProvider } from "./HelperFunctions/ActiveSearchContext";
import { Routes } from "react-router-dom";

function App() {
  return (
    <div>
      <Routes>
        <ActiveSearchProvider>
        <Route path="/" element={<MainPage />} />
          
        </ActiveSearchProvider>
      </Routes>
    </div>
  );
}

export default App;
